import React from "react";
// import "./post-component.css";

function PostCoponent({ profile, post }) {
  return (
    <article className="post-component">
      <header>
        <img
          src={
            profile.img
              ? profile.img
              : require(
                  "https://www.flaticon.com/svg/static/icons/svg/1256/1256650.svg"
                )
          }
        />
        <div>
          <h2>{profile.name ? profile.name : "name"}</h2>
          <p>{profile.follower ? profile.follower : "NoF"}</p>
        </div>
      </header>
      <maim>
        <img
          src={
            post.image
              ? post.image
              : require(
                  "https://i.pinimg.com/originals/3b/8a/d2/3b8ad2c7b1be2caf24321c852103598a.jpg"
                )
          }
        />

        <p>{post.detail ? post.detail : "Post Detail"}</p>
      </maim>
      <footer>
        <div className="post-footer-left">
          <p>like: {post.numberOfLike ? post.numberOfLike : "NoL"}</p>
          <p>comment: {post.numberOfComment ? post.numberOfComment : "NoC"}</p>
          <p>Chat</p>
        </div>
        <div className="post-footer-right"></div>
      </footer>
    </article>
  );
}

export default PostCoponent;
